geregisseerd door Scott Cooper
met Christian Bale, Zoe Saldana en Casey Affleck

Russell en zijn jongere broer Rodney wonen in Braddock, een dorpje gelegen in de economisch verpauperde Rust Belt in het noorden van Amerika. Russell is de noeste werker van de twee, die net als zijn pa tevreden is met zijn leven als fabrieksarbeider. Rodney daarentegen, als militair geplaagd door oorlogstrauma's, probeert rond te komen van gokgeld en prijzengeld dat hij wint met illegale boksgevechten. Hij werkt zich in de schulden en komt uit noodzaak in contact met een groep rednecks uit het berggebied dat boven Braddock ligt. Zij hebben hun eigen wetten en regels. Aan Russell om zijn broertje uit de oven te houden.


